@Ontouchgo helps advertisers increase store visitation and brand awareness via interactive display ads to passengers in Rideshare based on trip location, time of day, demographics, and other criteria. More than just "ads", each content is engaging and well video-graphed and helps highlight local places, events, and attractions. The company has worked with brands like Warner Bros for Space Jam - New Legacy and has donated ad-inventory to over 150+ business in 2020 during COVID-19 lockdowns.

You can make an investment reservation starting at $100 at the following link: wefunder.com/on.touch.go

Disclaimer: On Touch Go is "testing the waters" to gauge investor interest under Regulation Crowdfunding. Investment reservations are legally non-bidding. No offer of securities will be accepted until a Form C is filed and only through WeFundes platform.
